import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import Hero from "./components/Hero/Hero";

class App extends Component {
  render() {
    return (
      <div>
        <div className="hero_panel">
          <Hero />
          <Navbar />
        </div>
      </div>
    );
  }
}

export default App;
